import React from 'react';
import styled from 'styled-components';

import TodoItem from './TodoItem';

const Todo = ({ item }) => {
  return (
    <StyleTodoList key={item.id}>
      {item.schedule === '진행중' && (
        <div>
          <p>진행중</p>
          <TodoItem item={item} />
        </div>
      )}
      {item.schedule === '시작전' && (
        <div>
          <p>시작전</p>
          <TodoItem item={item} />
        </div>
      )}
      {item.schedule === '시작예정' && (
        <div>
          <p>시작예정</p>
          <TodoItem item={item} />
        </div>
      )}
      {item.schedule === '완료' && (
        <div>
          <p>완료</p>
          <TodoItem item={item} />
        </div>
      )}
    </StyleTodoList>
  );
};

export default Todo;

const StyleTodoList = styled.div`
  display: flex;
`;
